import { Container } from "react-bootstrap";
import { header } from "./components/Header";
const App = () => {
  return (
    <>
      <head />
      <main className="py-3">
        <Container>
          <h1>Welcome to my react-app</h1>;
        </Container>
      </main>
    </>
  );
};

export default App;
